import "./App.css";
import { useState } from "react";
import ThreeBackground from "./ThreeBackground";

const App = () => {
    const [loadMusic, setLoadMusic] = useState(false);

    return (
        <div className="app-container">
          <button onClick={()=>setLoadMusic(!loadMusic)}>
            Open
          </button>
            <ThreeBackground />
        </div>
    );
};

export default App;
